switch (int) {
    case org.eclipse.jgit.lib.Constants.int :
        org.eclipse.jgit.lib.ObjectChecker.checkCommit(byte[]);
        break;
    case org.eclipse.jgit.lib.Constants.int :
        org.eclipse.jgit.lib.ObjectChecker.checkTag(byte[]);
        break;
    case org.eclipse.jgit.lib.Constants.int :
        org.eclipse.jgit.lib.ObjectChecker.checkTree(byte[]);
        break;
    case org.eclipse.jgit.lib.Constants.int :
        org.eclipse.jgit.lib.ObjectChecker.checkBlob(byte[]);
        break;
    default :
        throw new org.eclipse.jgit.errors.CorruptObjectException(java.text.MessageFormat.format(org.eclipse.jgit.internal.JGitText.get().java.lang.String, java.lang.Integer.valueOf(int)));
}
